import React from "react";
import ReactDOM from "react-dom";

function HomePage() {
    return (
    <div>
        <nav className="navbar navbar-dark bg-primary py-3">
            <span className="navbar-text"><h3 className="navbar-text-color">Home</h3></span>
            <span className="navbar-text"><h3 className="navbar-text-color">Add/Edit</h3></span>
            <span className="navbar-text"><h3 className="navbar-text-color">Log Out</h3></span>
        </nav>
        <nav class="navbar navbar-light bg-light">
            <div className="container-fluid">
                <form className="d-flex">
                    <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
                    <button className="btn btn-outline-success" type="submit">Search</button>
                </form>
            </div>
        </nav>
    </div>);
}

export default HomePage;
